import React from 'react';
import * as ScrollArea from '@radix-ui/react-scroll-area';
import * as Accordion from '@radix-ui/react-accordion';




const ScrollAreaDemo = function ({ setPickedClub }) {

    const clubs = [
        {
            id: 1,
            name: 'Münazara',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Münazara Kulübü! Bütün karşıt fikirlerinizi doyasıya paylaşacağınız, hitabetinizi geliştireceğiniz, birbirinden farklı insanlar tanıyacağınız ve maçlarda unutulmayacak keyifli anılar biriktireceğiniz bir kulüp arıyorsanız; doğru yerdesiniz. Gelişmelerden haberdar olmak için takipte kalın, en yakın zamanda görüşmek üzere."
        },
        {
            id: 2,
            name: 'Fotoğrafçılık',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Fotoğrafçılık Kulübü! Eşsiz anları yakalamak ve paylaşmak isteyen herkesi bekliyoruz. Hem amatör hem de profesyonel fotoğrafçılar için bir araya gelerek birbirimizi destekleyeceğimiz, yeni teknikler öğreneceğimiz ve güzel anılar biriktireceğiz."
        },
        {
            id: 3,
            name: 'Yoga',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Yoga Kulübü! Zihninizi ve bedeninizi uyum içinde çalıştırmak için yoga pratiğine katılın. Stresi azaltın, esnekliğinizi artırın ve iç huzurunuzu bulun. Yoga deneyimine sahip olmanız gerekmez, her seviyeden katılımcıyı bekleriz."
        },
        {
            id: 4,
            name: 'Robotik',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Robotik Kulübü! Geleceğin teknolojisi olan robotik dünyasına katılın. Kendi robotlarınızı yapın, programlayın ve yarışmalara katılın. Teknolojiye ilgi duyan herkesi bekleriz."
        },
        {
            id: 5,
            name: 'Satranç',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Satranç Kulübü! Zihinsel becerilerinizi geliştirmek ve stratejik düşünme yeteneklerinizi artırmak için satranç oynamaya davetlisiniz. Hem acemi hem de deneyimli oyuncular hoş geldiniz."
        },
        {
            id: 6,
            name: 'Müzik',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Müzik Kulübü! Müziğe ilgi duyan herkesi bekleriz. Enstrüman çalmak, şarkı söylemek veya müzikle ilgili diğer yeteneklerinizi paylaşmak için harika bir platform."
        },
        {
            id: 7,
            name: 'Kitap Okuma',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Kitap Okuma Kulübü! Edebiyatın büyülü dünyasına katılın. Kitaplar hakkında tartışmak, yeni kitaplar keşfetmek ve edebi zevkinizi geliştirmek için sizleri bekleriz."
        },
        {
            id: 8,
            name: 'Gönüllülük',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Gönüllülük Kulübü! Topluma yardım etmek ve ihtiyaç sahiplerine destek olmak için bir araya gelin. Gönüllü projelerde yer almak ve sosyal sorumluluk bilincinizi geliştirmek için katılın."
        },
        {
            id: 9,
            name: 'Tiyatro',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Tiyatro Kulübü! Sahne performansı yapmak, tiyatro oyunları sahneye koymak veya sahne arkasında çalışmak isteyen tüm tiyatro severleri bekleriz."
        },
        {
            id: 10,
            name: 'Dans',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Dans Kulübü! Dans etmeyi seven ve dans becerilerini geliştirmek isteyen herkesi bekleriz. Farklı dans stilleri öğrenmek ve eğlenceli dans etkinliklerine katılmak için kulübümüze katılın."
        },
        {
            id: 11,
            name: 'Drama',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Drama Kulübü! Drama ve sahne performansına ilgi duyan herkesi bekleriz. Farklı rollerde oynayarak kendinizi keşfedin ve sahne deneyimini yaşayın."
        },
        {
            id: 12,
            name: 'Bilim ve Teknoloji',
            img: "https://raw.githubusercontent.com/Akiftsc/baalMunazara/master/img/clubLogo.jpg",
            description: "Bilim ve Teknoloji Kulübü! Bilime ve teknolojiye meraklı olan herkesi bekleriz. Bilimsel deneyler yapmak, teknoloji geliştirmek ve bilimle ilgili konuları tartışmak için bir araya gelin."
        }
    ];


    function clubClickHandler(e) {
        if (!e.target.parentElement.attributes.hasOwnProperty("id")) {
            setPickedClub(clubs[e.target.id - 1]);
            console.log(e.target.parentElement)
        }
    }


    return (
        <ScrollArea.Root className="lg:w-2/5 w-5/5 h-[500px]  rounded overflow-hidden shadow-[0_2px_10px] shadow-blackA7 bg-slate-800 border">
            <ScrollArea.Viewport className="w-full h-full rounded">
                <div className="py-[15px] px-5">
                    <div className="text-red-600 text-2xl text-center font-bold">
                        Kulüpler
                    </div>
                    {clubs.map((club) => (
                        <div href="#my_modal_8" onClick={clubClickHandler} id={club.id} key={club.id} className='flex align-center hover:opacity-70  justify-between p-4 bg-blackA5 border-b my-3 cursor-pointer'>
                            <img className='rounded-full' src={club.img} alt="clubImage" width={48} height={48} />
                            <h2 className='text-white'>{club.name}</h2>
                        </div>
                    ))}
                </div>
            </ScrollArea.Viewport>
            <ScrollArea.Scrollbar
                className="flex select-none touch-none p-0.5 bg-blackA6 transition-colors duration-[160ms] ease-out hover:bg-blackA8 data-[orientation=vertical]:w-2.5 data-[orientation=horizontal]:flex-col data-[orientation=horizontal]:h-2.5"
                orientation="vertical"
            >
                <ScrollArea.Thumb className="flex-1 bg-mauve10 rounded-[10px] relative before:content-[''] before:absolute before:top-1/2 before:left-1/2 before:-translate-x-1/2 before:-translate-y-1/2 before:w-full before:h-full before:min-w-[44px] before:min-h-[44px]" />
            </ScrollArea.Scrollbar>
            <ScrollArea.Scrollbar
                className="flex select-none touch-none p-0.5 bg-blackA6 transition-colors duration-[160ms] ease-out hover:bg-blackA8 data-[orientation=vertical]:w-2.5 data-[orientation=horizontal]:flex-col data-[orientation=horizontal]:h-2.5"
                orientation="horizontal"
            >
                <ScrollArea.Thumb className="flex-1 bg-mauve10 rounded-[10px] relative before:content-[''] before:absolute before:top-1/2 before:left-1/2 before:-translate-x-1/2 before:-translate-y-1/2 before:w-full before:h-full before:min-w-[44px] before:min-h-[44px]" />
            </ScrollArea.Scrollbar>
            <ScrollArea.Corner className="bg-blackA8" />
        </ScrollArea.Root>
    )
};

export default ScrollAreaDemo;
